        public FakeBinanceExchange(ILogger logger, string orderBookJson = null)
            : base("FakeBinanceExchange")
        {
            TakerFeePercentage = PercentageValue.FromPercentage(0.3m);
            MakerFeePercentage = PercentageValue.FromPercentage(0.0m);

            var settings = new JsonSerializerSettings
            {
                ContractResolver = new SisoJsonDefaultContractResolver()
            };

            m_orderBook = Newtonsoft.Json.JsonConvert.DeserializeObject<OrderBook>((orderBookJson ?? DefaultOrderBookJson).Replace("'", "\""), settings);
        }

        public class SisoJsonDefaultContractResolver : DefaultContractResolver
        {
            protected override JsonProperty CreateProperty(
                MemberInfo member,
                MemberSerialization memberSerialization)
            {
                //TODO: Maybe cache
                var prop = base.CreateProperty(member, memberSerialization);

                if (!prop.Writable)
                {
                    var property = member as PropertyInfo;
                    if (property != null)
                    {
                        var hasPrivateSetter = property.GetSetMethod(true) != null;
                        prop.Writable = hasPrivateSetter;
                    }
                }

                return prop;
            }
        }

        public override async Task<IOrderBook> GetOrderBook(AssetPair assetPair)
        {
            await Task.Yield();
            return m_orderBook;
        }
    }

    public class SimulatedBinanceExchange : Common.Simulation.SimulatedExchangeBase
    {
        private BinanceExchange m_realBinance;

        public SimulatedBinanceExchange(BinanceConfiguration configuration, ILogger logger)
            : base("SimulatedBinance")
        {
            m_realBinance = new BinanceExchange(configuration, logger);

            TakerFeePercentage = m_realBinance.TakerFeePercentage;
            MakerFeePercentage = m_realBinance.MakerFeePercentage;
        }

        public override Task<IOrderBook> GetOrderBook(AssetPair assetPair)
        {
            return m_realBinance.GetOrderBook(assetPair);
        }
    } 
